  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:20.144191\",\n\t\"name\": \"grassland-management-plan-montezuma-national-wildlife-refuge-1982\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This plan supports the establishment of
  approximately 250 acres of additional managed waterfowl nesting cover and will provide
  the opportunity to achieve the following refuge goals: 1. Establish a tradition
  of upland waterfowl nesting heretofore nonexistent because of past land use practices.
  2. Supplement existing waterfowl nesting cover and potentially serve to augment
  annual waterfowl production consistent with stated purposes and objective levels.
  3. Provide more diverse interpretive and environmental education opportunities consistent
  with stated refuge objectives. 4. Demonstrate land use practices beneficial to non-
  arboreal species of wildlife which commonly utilize early succession plant communities.\",\n\t\"license_title\":
